import React from 'react';
import Container from 'react-bootstrap/Container';
// import { Link } from 'react-router-dom'
import './Navbar.css';

function NavbarLandingPage() {
  const nvar=useNavigate();
    const lognav=()=>{
        nvar("/login");
    }
    const regnav=()=>{
        nvar("/register/");
    }
  return (
    <div>
      <nav className="navbarlandingpage">
        <Container>
          <div className="navrightlandingpage">
            <button className="custombtnlandingpage" onClick={lognav}>LOGIN</button>
            <button className="custombtnlandingpage">REGISTRATION</button>
          </div>
        </Container>
      </nav>
    </div>
  );
}

export default NavbarLandingPage;
